import React from "react";
import Button from "@material-ui/core/Button";
import { Paper, Container } from "@material-ui/core";

function App() {
  return (
    <>
    <CssBaseline />
      <Container maxWidth="xs">
        <Paper>
          <Button variant="contained" color="primary">
            Hello World
          </Button>
        </Paper>
      </Container>
    </>
  );
}

export default App;
